(11967, 0, '2021-10-0438', 0, '3222', 'OUTPUT/DELIVERABLES\r\n\r\n1)	One (1) 5-7 minute Video on Mandanas-SC Ruling in CALABARZON Setting\r\n\r\nAs stated in the introduction, the AVP shall feature salient points in the implementation of the full devolution in FY 2022.\r\n	\r\nTechnical Specifications\r\n\r\nThe video shall be submitted in at least HD and UHD Video formats or any other appropriate format/s for excellent quality in all media the videos may be used in, including television, web, and mobile.\r\n\r\n-	Audio Format: Digital non-linear, Stereo\r\n-	Aspect Ratio: 16:9, optimizable for 4:3 screen format\r\n-	Resolution: 1920 x 1080 and 4K (3840 x 2160)\r\n\r\nAll 2D and 3D assets, icons, graphics, sounds, and music shall be customized for the AVP and submitted to the DILG IV-A along with the final video.\r\n\r\nThe video should be free of any obvious or easy-to-see noise, compression artifacts, gradient banding, or other visual quality issues.\r\n\r\nPackaging\r\n\r\nFinal output, project files, raw graphics, and assets, as well as the edit masters shall be packaged for submission in a portable hard drive. Additionally, three (3) DVD copies of the final output shall be required for submission. \r\n\r\n2. Layout and design of Mandanas-SC Ruling Primer\r\n\r\nAs stated in the introduction, the primer shall feature salient points in the implementation of the full devolution in FY 2022.\r\n\r\nTechnical Specifications\r\n\r\nThe primer shall be submitted in raw and pdf formats or any other appropriate format/s for excellent quality in all media the primer may be used in, including our social media pages, and print media.\r\n\r\n- 5.845 in x 8.27 inches\r\n- 15 pages including front and back cover\r\n- Cover: 300gsm CS2, Inside pages: 100gsm CS2\r\n- Colors: 4/4 Cover, 4/4 Inside\r\n- Binding: Perfect\r\n\r\nPackaging\r\nFinal output, project files, raw graphics, and assets, as well as the edit masters shall be packaged for submission in a portable hard drive. Additionally, two (2) DVD copies of the final output shall be required for submission. ', 4, 1, 350000, '', '2021-10-16 04:01:14'),
