(12104, 0, '2021-10-0481', 0, '3319', 'Scope of Work\r\n\r\n1.	All participating service provider are required to inspect the areas to be provided with the disinfectant misting services at the Department of the Interior and Local Government, Region IV-A CALABARZON, Andenson Bldg. 1, Brgy. Parian, Calamba City, Laguna including the premises and all facilities there at.\r\n\r\n2.	The winning service provider shall conduct disinfectant misting twice every month and must be done on Sundays, which shall commence upon signing of the contract, and shall undertake the following:\r\n\r\n-General Disinfectant Misting of various Offices in the DILG IV-A CALABARZON, including the parking areas and offices of the DILG IV-A CALABARZON - Office located at the Andenson Building 1, covering the 4th floor, 3rd floor and the basement with a total area of One Thousand Three Hundred Eighty square meters (1,380 sqm). It shall begin at the top floor and continue downward until the building is completely serviced;\r\n\r\n-The disinfectant must be formulated or manufactured with surfactants belonging to alkylphenol ethoxylates (APEOs), ethylene diamine tetra acedic acid (EDTA) or nitrilotriacetate (NTA). Formulated or manufactured with builders belonging to phosphates. It shall not be formulated with any chemicals that are included in the International Agency of Research on Cancer (IARC) lists for proven (Group 1), probable (Group 2A), or possible (Group 2B) carcinogens. The disinfectant must not be formulated or manufactured with aromatic compounds;\r\n-The service provider shall furnish all supervision, labor, materials, devices and other equipment necessary to perform effective, sanitary and ecologically sound disinfectant misting services for all areas in the building and surroundings;\r\n-DILG IV-A CALABARZON shall not be liable for canceling scheduled operations due to scheduling conflicts or unforeseen circumstances;\r\n-DILG IV-A CALABARZON has the option to discontinue the disinfectant misting services upon determination that there is no need for the said services;\r\n-DILG IV-A CALABARZON reserves the right to reject any and/or all bids, waive any formality therein and to make an award to the service provider whose proposal is most advantageous to the government.', 4, 1, 120000, '', '2021-10-26 02:56:11'),
