(12220, 0, '2021-10-0521', 0, '3375', 'A. One (1) 3â€“5-minute Video featuring the best practices and success stories of beneficiaries of the PDMU-administered projects during the pandemic; \r\n\r\nAs stated in the introduction, the AVP shall feature the success stories (before and after the implementation) of the project and its benefits to the people and community	\r\n\r\n6.1.1	Technical Specifications\r\n\r\nThe video shall be submitted in at least HD and UHD Video formats or any other appropriate format/s for excellent quality in all media the videos may be used in, including television, web, and mobile.\r\n\r\n-	Audio Format: Digital non-linear, Stereo\r\n-	Aspect Ratio: 16:9, optimizable for 4:3 screen format\r\n-	Resolution: 1920 x 1080 and 4K (3840 x 2160)\r\n\r\nAll 2D and 3D assets, icons, graphics, sounds, and music shall be customized for the AVP and submitted to the DILG IV-A along with the final video.\r\n\r\nThe video should be free of any obvious or easy-to-see noise, compression artifacts, gradient banding, or other visual quality issues.\r\n\r\n6.1.2	Packaging\r\n\r\nFinal output, project files, raw graphics, and assets, as well as the edit masters shall be packaged for submission in a portable hard drive. Additionally, three (3) DVD copies of the final output shall be required for submission. \r\n\r\nB. Layout and design of PDMU IEC Materials 2021\r\n\r\nAs stated in the introduction, the PDMU IEC materials (PDMU Magazine 2021, Wall Calendar FY 2022, Planner FY 2022, and Table Calendar FY 2022) shall feature the completed projects of PDMU-administered projects\r\n\r\n-	Technical Specifications\r\n\r\na.	The PDMU Magazine FY 2021 shall be submitted in raw and pdf formats or any other appropriate format/s for excellent quality in all media the primer may be used in, including our social media pages, and print media.\r\n\r\n- Size: A4, glossy\r\n- Pages: 50 pages (including back and front)\r\n- Full Color\r\n\r\nb.	The Planner FY 2022 shall be submitted in raw and pdf formats or any other appropriate format/s for excellent quality in all media the primer may be used in, including our social media pages, and print media.\r\n\r\n- Size: A5, glossy\r\n- Pages: 140 pages (including back and front)\r\n- Full Color\r\n\r\nc.	The Wall Calendar FY 2022 shall be submitted in raw and pdf formats or any other appropriate format/s for excellent quality in all media the primer may be used in, including our social media pages, and print media.\r\n\r\n- Size: 28 inches (W) x 19 inches (H)\r\n- Pages: 14 pages (including back and front)\r\n- Full Color\r\n\r\nd.	The Table Calendar FY 2022 shall be submitted in raw and pdf formats or any other appropriate format/s for excellent quality in all media the primer may be used in, including our social media pages, and print media.\r\n\r\n- Size: 11.5 x 17 inches\r\n- Pages: 12 pages \r\n- Full Color\r\n\r\n	Packaging\r\n\r\nFinal output, project files, raw graphics, and assets, as well as the edit masters shall be packaged for submission in a portable hard drive. Additionally, two (2) DVD copies of the final output shall be required for submission. \r\n\r\nC. Edited/Enhancement of submitted pictures\r\nD.  Transcript of interviews/recorded videos', 4, 1, 53000, '', '2021-10-28 12:07:06'),
